%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%


A_org = A;
[rowsA,colsA] = size(A); 

numnodes = rowsA*colsA;
src_nodes=zeros(1,numnodes);
dst_nodes=zeros(1,numnodes);
T_count=0;

tline = fgetl(fid);

while ischar(tline)
     str=length(tline);  
     if tline(1)=='-' % topo title;
          disp(tline);
     else
         if tline(1)=='=' % topo title;
               disp(tline);       
         end
     end 

     if tline(1)=='t' % topo title;
          if T_count~=0
               % disp('topology');
               disp(T_count);
               % disp('--------------------------');
               for k = 1:colsA
                    for i = 1:rowsA
                         if i==src_nodes(k)
                              for j = 1:colsA
                                   if j==dst_nodes(k)
                                        A(i,j)=2; 
                                        A(j,i)=2; % symmetrics
                                   end
                              end
                         end
                    end
               end

               % disp(src_nodes);
               % disp(dst_nodes);
               % disp('--------------------------');
               % disp(A);
               disp(A);

               % reset
               count=0;
               A = A_org;
               src_nodes = zeros(1,colsA);
               dst_nodes = zeros(1,colsA);
          end
          T_count=T_count+1;
     else
          if str==4
               % disp(tline);
               count = count+1;
               src_nodes(count)=str2num(tline(1));
               dst_nodes(count)=str2num(tline(3));
          end

          if str==5
               % x-yz; xy-z;
               % disp(tline);
               if tline(3)=='-'    
                    % disp(tline);
                    count=count+1;
                    src_nodes(count) = str2num(strcat(tline(1),tline(2)));
                    dst_nodes(count) = str2num(tline(4));
               end
               if tline(2)=='-'    
                    % disp(tline);
                    count=count+1;
                    dst_nodes(count) = str2num(strcat(tline(3),tline(4)));
                    src_nodes(count) = str2num(tline(1));
               end
          end

          if str==6
               % disp(tline);
               count=count+1;
               dst_nodes(count) = str2num(strcat(tline(3),tline(4)));
               src_nodes(count) = str2num(strcat(tline(1),tline(2)));
          end
     end
     disp(tline); % topo id display 
     tline=fgetl(fid); % increment
end
fclose(fid);

